import { useEffect } from "react";
import { Helmet } from "react-helmet";

export default function Reservations() {
  useEffect(() => {
    // Load the Resy script dynamically
    const script = document.createElement("script");
    script.src = "https://widgets.resy.com/embed.js";
    script.async = true;

    script.onload = () => {
      if (window.resyWidget) {
        window.resyWidget.addButton(document.getElementById("resyButton"), {
          venueId: 9985,
          apiKey: "okbCVZshqhoQQYn7zT68y7aDSxhvLFdP",
          replace: true,
        });
      }
    };

    document.body.appendChild(script);

    return () => {
      // Cleanup (optional)
      document.body.removeChild(script);
    };
  }, []);

  return (
    <>
      <Helmet>
        <title>Reservations | Carmello’s Restaurant & Wine Bar</title>
        <meta
          name="description"
          content="Reserve your table at Carmello’s Restaurant & Wine Bar through our Resy online booking system. Secure your fine dining experience today."
        />
        <meta property="og:title" content="Reserve a Table at Carmello’s" />
        <meta
          property="og:description"
          content="Book your reservation at Charlottesville’s top Italian dining destination."
        />
        <meta property="og:image" content="/images/carmellos1.jpg" />
      </Helmet>
      <div className="bg-black text-white min-h-screen pt-24 px-6 text-center">
        <h1 className="text-5xl font-serif text-gold mb-12">Reservations</h1>

        <a
          href="https://resy.com/cities/charlottesville-va/venues/carmellos-restaurant-wine-bar"
          id="resyButton"
          className="text-gold text-2xl underline"
        >
          Book your Carmello's Restaurant & Wine Bar reservation on Resy
        </a>
      </div>
    </>
  );
}
